	(44,109,1,'2019-01-19 09:44:34','2019-01-21 00:36:10','035df5b1-e636-4b9b-9758-dd1f5f2a0967',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'{# @var craft \\craft\\web\\twig\\variables\\CraftVariable #}\r\n{# @var entry \\craft\\elements\\Entry #}\r\n{#\r\n  a-code\r\n  ------------------------------------------------------------\r\n#}\r\n\r\n{# -- Set Defaults -- #}\r\n{% set defaults = {\r\n  cn: \'a-codeSnippet\',\r\n  modifiers: [],\r\n  customClasses: [],\r\n  data: {},\r\n  js: true,\r\n  vSpace: null,\r\n  open: true,\r\n  textShow: \'Expand Code Block\',\r\n  textHide: \'Collapse Code Block\',\r\n  snippet: null,\r\n  language: null\r\n} %}\r\n\r\n{# -- Merge Default with Options -- #}\r\n{% set opt = opt is defined ? defaults|merge(opt) : defaults %}\r\n\r\n{# -- Modul -- #}\r\n{% if opt.snippet %}\r\n  <div class=\"{{ opt.cn }}\r\n              {% for modifier in opt.modifiers %}\r\n                {{ modifier | length ? \'  \' ~ opt.cn ~ \'--\' ~ modifier }}\r\n              {% endfor %}\r\n              {% for customClass in opt.customClasses %}\r\n                {{ customClass | length ? \'  \' ~ customClass }}\r\n              {% endfor %}  {{ opt.js ? opt.cn|replace({ \'a-\' : \'js-\' }) : \'\' }}\"\r\n    {% for key, value in opt.data %}\r\n      {{ \'data-\' ~ key ~ \'=\' ~ value }}\r\n    {% endfor %} data-status=\"{{ opt.open ? \'open\' : \'closed\' }}\">\r\n    <div class=\"{{ opt.cn ~ \'__wrapper\' }}\">\r\n      <div class=\"{{ opt.cn ~ \'__inner\' }}\">\r\n        {% spaceless %}\r\n          <pre class=\"line-numbers  language-{{ opt.language }}  {{ opt.cn ~ \'__codeWrapper\' }}\">\r\n            <code class=\"{{ opt.cn ~ \'__code\' }}\">{{- opt.snippet | e -}}</code>\r\n          </pre>\r\n        {% endspaceless %}\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <span class=\"{{ opt.cn ~ \'__toggle\' }}\"\r\n        data-status=\"{{ opt.open ? \'open\' : \'closed\' }}\"\r\n        data-show=\"{{ opt.textShow }}\"\r\n        data-hide=\"{{ opt.textHide }}\">\r\n    <span class=\"{{ opt.cn ~ \'__toggleTextHolder\' }} js-textHolder\">{{ opt.open ? opt.textHide : opt.textShow }}</span>\r\n  </span>\r\n{% endif %}\r\n','twig',NULL,NULL),
